# 1600. Throne Inheritance
import time
class ThroneInheritance:
    
    def __init__(self, kingName):
        self.king_dict = dict()
        self.kingName = kingName
        self.king_dict[kingName] = []
        self.death_list = set()
        self.king_order = [kingName]

    def birth(self, parentName, childName):
        self.king_dict[parentName].append(childName)
        self.king_dict[childName] = []
        
    def death(self, name):
        self.death_list.add(name)

    def getInheritanceOrder(self):
        if self.kingName in self.death_list:
            self.king_order = []
        else:        
            self.king_order = [self.kingName]
        self.dfs(self.king_dict[self.kingName])
        return self.king_order

    def dfs(self,child_list):
        for child in child_list:
            if child not in self.death_list:
                self.king_order.append(child)
            if not self.king_dict[child]:
                # the child list is empty
                continue
            else:
                self.dfs(self.king_dict[child])
        return
                
                

def main(operations, data):
    for i in range(len(operations)):
        if operations[i] == "ThroneInheritance":
            obj = ThroneInheritance(data[i][0])
        elif operations[i] == "birth":
            obj.birth(data[i][0],data[i][1])
        elif operations[i] == "death":
            obj.death(data[i][0])
        elif operations[i] == "getInheritanceOrder":
            orders = obj.getInheritanceOrder()
            print(orders)

